import React from 'react';

import content from '../../Components/blog/posts/web_scraping.md';
import MarkDown from '../../Components/blog/markdown-parser/MarkDown';


const WebScraping = () => {
    return (
           <div className="main">
        	<MarkDown content={content} />
        	</div>
    );
};

export default WebScraping;
